[
  {
    "id": "app_window_libreoffice_writer",
    "type": "application_window",
    "text": "Sem título 1 — LibreOffice Writer",
    "region": "top-bar",
    "meta": {
      "application_name": "LibreOffice Writer",
      "document_title": "Sem título 1"
    }
  },
  {
    "id": "menu_arquivo",
    "type": "menu_item",
    "text": "Arquivo",
    "region": "top-bar",
    "actions": ["onClick"]
  },
  {
    "id": "menu_editar",
    "type": "menu_item",
    "text": "Editar",
    "region": "top-bar",
    "actions": ["onClick"]
  },
  {
    "id": "menu_exibir",
    "type": "menu_item",
    "text": "Exibir",
    "region": "top-bar",
    "actions": ["onClick"]
  },
  {
    "id": "menu_inserir",
    "type": "menu_item",
    "text": "Inserir",
    "region": "top-bar",
    "actions": ["onClick"]
  },
  {
    "id": "menu_formatar",
    "type": "menu_item",
    "text": "Formatar",
    "region": "top-bar",
    "actions": ["onClick"]
  },
  {
    "id": "menu_estilos",
    "type": "menu_item",
    "text": "Estilos",
    "region": "top-bar",
    "actions": ["onClick"]
  },
  {
    "id": "menu_tabela",
    "type": "menu_item",
    "text": "Tabela",
    "region": "top-bar",
    "actions": ["onClick"]
  },
  {
    "id": "menu_formulario",
    "type": "menu_item",
    "text": "Formulário",
    "region": "top-bar",
    "actions": ["onClick"]
  },
  {
    "id": "menu_ferramentas",
    "type": "menu_item",
    "text": "Ferramentas",
    "region": "top-bar",
    "actions": ["onClick"]
  },
  {
    "id": "menu_janela",
    "type": "menu_item",
    "text": "Janela",
    "region": "top-bar",
    "actions": ["onClick"]
  },
  {
    "id": "menu_ajuda",
    "type": "menu_item",
    "text": "Ajuda",
    "region": "top-bar",
    "actions": ["onClick"]
  },
  {
    "id": "toolbar_paragraph_style",
    "type": "dropdown",
    "text": "Estilo de parágrafo Padrão",
    "region": "toolbar",
    "actions": ["onChange"]
  },
  {
    "id": "toolbar_font_family",
    "type": "dropdown",
    "text": "Arial",
    "region": "toolbar",
    "actions": ["onChange"]
  },
  {
    "id": "toolbar_font_size",
    "type": "dropdown",
    "text": "12 pt",
    "region": "toolbar",
    "actions": ["onChange"]
  },
  {
    "id": "toolbar_bold",
    "type": "button",
    "text": "Negrito",
    "region": "toolbar",
    "actions": ["onClick"],
    "meta": {
      "icon": "B"
    }
  },
  {
    "id": "toolbar_italic",
    "type": "button",
    "text": "Itálico",
    "region": "toolbar",
    "actions": ["onClick"],
    "meta": {
      "icon": "I"
    }
  },
  {
    "id": "toolbar_underline",
    "type": "button",
    "text": "Sublinhado",
    "region": "toolbar",
    "actions": ["onClick"],
    "meta": {
      "icon": "S"
    }
  },
  {
    "id": "document_area",
    "type": "document_canvas",
    "text": null,
    "region": "main-content",
    "meta": {
      "status": "empty"
    }
  },
  {
    "id": "status_bar_page_info",
    "type": "label",
    "text": "Página 1 de 1",
    "region": "footer"
  },
  {
    "id": "status_bar_word_count",
    "type": "label",
    "text": "0 palavra, 0 caractere",
    "region": "footer"
  },
  {
    "id": "status_bar_page_style",
    "type": "label",
    "text": "Estilo de página Padrão",
    "region": "footer"
  },
  {
    "id": "status_bar_language",
    "type": "label",
    "text": "Português (Brasil)",
    "region": "footer"
  },
  {
    "id": "status_bar_zoom_slider",
    "type": "slider",
    "text": null,
    "region": "footer",
    "meta": {
      "min": 20,
      "max": 600,
      "current_value": "100%"
    },
    "actions": ["onChange"]
  },
  {
    "id": "modal_signature_line",
    "type": "modal",
    "text": "Linha de assinatura",
    "region": "center",
    "meta": {
      "title": "Linha de assinatura"
    }
  },
  {
    "id": "modal_button_minimize",
    "type": "button",
    "text": "Minimizar",
    "region": "modal_header",
    "actions": ["onClick"],
    "meta": {
      "icon": "minimize"
    }
  },
  {
    "id": "modal_button_maximize_restore",
    "type": "button",
    "text": "Maximizar/Restaurar",
    "region": "modal_header",
    "actions": ["onClick"],
    "meta": {
      "icon": "maximize/restore"
    }
  },
  {
    "id": "modal_button_close",
    "type": "button",
    "text": "Fechar",
    "region": "modal_header",
    "actions": ["onClick"],
    "meta": {
      "icon": "close"
    }
  },
  {
    "id": "modal_section_signatario_sugerido",
    "type": "section_title",
    "text": "Signatário sugerido",
    "region": "modal_content"
  },
  {
    "id": "label_nome",
    "type": "label",
    "text": "Nome:",
    "region": "modal_content",
    "meta": {
      "for": "input_nome"
    }
  },
  {
    "id": "input_nome",
    "type": "input",
    "text": "José da Silva",
    "state": "filled",
    "region": "modal_content",
    "actions": ["onInput", "onChange"],
    "meta": {
      "input_type": "text"
    }
  },
  {
    "id": "label_titulo",
    "type": "label",
    "text": "Título:",
    "region": "modal_content",
    "meta": {
      "for": "input_titulo"
    }
  },
  {
    "id": "input_titulo",
    "type": "input",
    "text": "Diretor",
    "state": "placeholder",
    "region": "modal_content",
    "actions": ["onInput", "onChange"],
    "meta": {
      "input_type": "text"
    }
  },
  {
    "id": "label_email",
    "type": "label",
    "text": "E-mail:",
    "region": "modal_content",
    "meta": {
      "for": "input_email"
    }
  },
  {
    "id": "input_email",
    "type": "input",
    "text": "silva@exemplo.org",
    "state": "filled",
    "region": "modal_content",
    "actions": ["onInput", "onChange"],
    "meta": {
      "input_type": "email"
    }
  },
  {
    "id": "modal_section_mais",
    "type": "section_title",
    "text": "Mais",
    "region": "modal_content"
  },
  {
    "id": "checkbox_anotacoes",
    "type": "checkbox",
    "text": "Signatário pode adicionar anotações",
    "state": "checked",
    "region": "modal_content",
    "actions": ["onClick", "onChange"]
  },
  {
    "id": "checkbox_mostrar_data",
    "type": "checkbox",
    "text": "Mostrar data da assinatura na linha de assinatura",
    "state": "checked",
    "region": "modal_content",
    "actions": ["onClick", "onChange"]
  },
  {
    "id": "label_instrucoes_signatario",
    "type": "label",
    "text": "Instruções para o signatário:",
    "region": "modal_content",
    "meta": {
      "for": "textarea_instrucoes"
    }
  },
  {
    "id": "textarea_instrucoes",
    "type": "textarea",
    "text": null,
    "state": "empty",
    "region": "modal_content",
    "actions": ["onInput", "onChange"]
  },
  {
    "id": "button_ajuda",
    "type": "button",
    "text": "Ajuda",
    "region": "modal_footer",
    "actions": ["onClick"]
  },
  {
    "id": "button_ok",
    "type": "button",
    "text": "OK",
    "state": "active",
    "region": "modal_footer",
    "actions": ["onClick"],
    "meta": {
      "is_primary": true
    }
  },
  {
    "id": "button_cancelar",
    "type": "button",
    "text": "Cancelar",
    "region": "modal_footer",
    "actions": ["onClick"]
  }
]
